import React from 'react';
import './societyTable.css'
function SocietyTable() {
    // Sample society data
    const societyData = [
        { id: 1, name: 'Green Valley Apartments', address: '123 Main Street' },
        { id: 2, name: 'Lakeside Residency', address: '456 Oak Avenue' },
        { id: 3, name: 'Sunset Condos', address: '789 Elm Street' }
    ];

    return (
        <div className="card1">
            <h2 className="card-title">Society Table</h2>
            <div className="table-container">
                <table className="society-table">
                    <thead>
                        <tr>
                            <th>ID</th>
                            <th>Society Name</th>
                            <th>Address</th>
                        </tr>
                    </thead>
                    <tbody>
                        {societyData.map(society => (
                            <tr key={society.id}>
                                <td>{society.id}</td>
                                <td>{society.name}</td>
                                <td>{society.address}</td>
                            </tr>
                        ))}
                    </tbody>
                </table>
            </div>
        </div>
    );
}

export default SocietyTable;
